import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import {
  Box,
  Typography,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  CircularProgress,
  Paper,
} from '@mui/material';
import { getStudentTimesheetById } from '../services/adminService';
import Navbar from '../components/Navbar';
import { useAuth } from '../context/AuthContext';

function StudentTimesheetView() {
  const { id } = useParams();
  const { token } = useAuth();
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [studentInfo, setStudentInfo] = useState({ studentId: '', fullName: '' });

  useEffect(() => {
    const fetchTimesheet = async () => {
      try {
        const res = await getStudentTimesheetById(id, token);
        setData(res.data);
        if (res.data.length > 0) {
          const first = res.data[0];
          setStudentInfo({
            studentId: first.user?.studentId || id,
            fullName: first.user?.fullName || '',
          });
        } else {
          setStudentInfo({ studentId: id, fullName: '' });
        }
      } catch (err) {
        alert('โหลดข้อมูล Timesheet ไม่สำเร็จ');
      } finally {
        setLoading(false);
      }
    };
    fetchTimesheet();
  }, [id, token]);

  const formatTime = (dateString) => {
    if (!dateString) return '-';
    const date = new Date(dateString);
    return date.toLocaleTimeString([], { hour: '2-digit', minute: '2-digit' });
  };

  return (
    <>
      <Navbar />
      <Box
        sx={{
          p: 4,
          maxWidth: 900,
          mx: 'auto',
          backgroundColor: '#f4f6f8',
          minHeight: '80vh',
          fontFamily: "'Poppins', sans-serif",
        }}
      >
        <Typography
          variant="h5"
          gutterBottom
          sx={{ fontWeight: 'bold', color: '#2e7d32', mb: 3 }}
        >
          Timesheet ของนักศึกษา
          {studentInfo.studentId && ` รหัส ${studentInfo.studentId}`}
          {studentInfo.fullName && ` ชื่อ ${studentInfo.fullName}`}
        </Typography>

        {loading ? (
          <Box sx={{ textAlign: 'center', mt: 10 }}>
            <CircularProgress size={48} color="success" />
          </Box>
        ) : data.length === 0 ? (
          <Typography
            variant="body1"
            sx={{ textAlign: 'center', color: 'text.secondary', mt: 6 }}
          >
            ยังไม่มี Timesheet ของนักศึกษาคนนี้
          </Typography>
        ) : (
          <Paper
            elevation={2}
            sx={{
              overflowX: 'auto',
              borderRadius: 3,
              border: '1px solid #c8e6c9',
              boxShadow: '0 3px 10px rgba(46,125,50,0.1)',
            }}
          >
            <Table>
              <TableHead>
                <TableRow sx={{ bgcolor: '#e8f5e9' }}>
                  <TableCell sx={{ fontWeight: 'bold', color: '#2e7d32' }}>
                    วันที่
                  </TableCell>
                  <TableCell sx={{ fontWeight: 'bold', color: '#2e7d32' }}>
                    เวลาเข้า
                  </TableCell>
                  <TableCell sx={{ fontWeight: 'bold', color: '#2e7d32' }}>
                    เวลาออก
                  </TableCell>
                  <TableCell sx={{ fontWeight: 'bold', color: '#2e7d32' }}>
                    กิจกรรม
                  </TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {data.map((t) => (
                  <TableRow key={t.id} hover>
                    <TableCell>
                      {new Date(t.date).toLocaleDateString('th-TH', {
                        year: 'numeric',
                        month: 'long',
                        day: 'numeric',
                      })}
                    </TableCell>
                    <TableCell>{formatTime(t.checkInTime)}</TableCell>
                    <TableCell>{formatTime(t.checkOutTime)}</TableCell>
                    <TableCell style={{ whiteSpace: 'pre-line' }}>{t.activity}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
        )}
      </Box>
    </>
  );
}

export default StudentTimesheetView;
